var suggestions=document.getElementById("suggestions"),search=document.getElementById("search");search!==null&&document.addEventListener("keydown",inputFocus);function inputFocus(e){e.ctrlKey&&e.key==="/"&&(e.preventDefault(),search.focus()),e.key==="Escape"&&(search.blur(),suggestions.classList.add("d-none"))}document.addEventListener("click",function(e){var t=suggestions.contains(e.target);t||suggestions.classList.add("d-none")}),document.addEventListener("keydown",suggestionFocus);function suggestionFocus(n){const s=suggestions.classList.contains("d-none");if(s)return;const e=[...suggestions.querySelectorAll("a")];if(e.length===0)return;const t=e.indexOf(document.activeElement);if(n.key==="ArrowUp"){n.preventDefault();const s=t>0?t-1:0;e[s].focus()}else if(n.key==="ArrowDown"){n.preventDefault();const s=t+1<e.length?t+1:t;e[s].focus()}}(function(){var e=new FlexSearch.Document({tokenize:"forward",cache:100,document:{id:"id",store:["href","title","description"],index:["title","description","content"]}});e.add({id:0,href:"/docs/dev/securite-applicative/",title:"Sécurité applicative",description:"La formation sécurité applicative propose :\n Un panorama des principales failles applicatives connues :  Comprendre les scénarios d\u0026rsquo;attaque à travers des démonstrations d\u0026rsquo;exploitation Comprendre les mécanismes de sécurité existant pour les éviter Attaques par injection de code, XSS, CSRF Distinguer protections actives et déclaratives (telles que CORS)   Une présentation de fonctionnement de HTTPS :  Source de mauvaise compréhension et d\u0026rsquo;irritants pendant les mises en production mais indispensable aujourd\u0026rsquo;hui Comprendre la structure à travers une mise en place en local   L\u0026rsquo;authentification des applications  Grands principes, fonctionnement d\u0026rsquo;une architecture d\u0026rsquo;authentification centralisée Mécanismes de jeton, tranfert d\u0026rsquo;identité et autorisation Mise en pratique en java (jee pur et spring boot), js (pur et react), authentifié sur un keycloak installé localement pour lever toute mystification    Support",content:"La formation sécurité applicative propose :\n Un panorama des principales failles applicatives connues :  Comprendre les scénarios d\u0026rsquo;attaque à travers des démonstrations d\u0026rsquo;exploitation Comprendre les mécanismes de sécurité existant pour les éviter Attaques par injection de code, XSS, CSRF Distinguer protections actives et déclaratives (telles que CORS)   Une présentation de fonctionnement de HTTPS :  Source de mauvaise compréhension et d\u0026rsquo;irritants pendant les mises en production mais indispensable aujourd\u0026rsquo;hui Comprendre la structure à travers une mise en place en local   L\u0026rsquo;authentification des applications  Grands principes, fonctionnement d\u0026rsquo;une architecture d\u0026rsquo;authentification centralisée Mécanismes de jeton, tranfert d\u0026rsquo;identité et autorisation Mise en pratique en java (jee pur et spring boot), js (pur et react), authentifié sur un keycloak installé localement pour lever toute mystification    Support\nTps\n"}).add({id:1,href:"/docs/ensai/projet-ensai/seances-suivi/",title:"Séances de suivi",description:"La note bibliographique # Remarques\n En rester à des publications statistiques, notemment des analyses sociologiques (un bon article de presse va s\u0026rsquo;appuyer sur une publication)  A quoi ça servira ?\n Il faut au maximum se baser sur des références bibliographiques (éviter le \u0026ldquo;on sait que\u0026hellip;\u0026rdquo;) Avoir des éléments \u0026ldquo;métier\u0026rdquo; sur le sujet (Introduction, cadrage, plan, \u0026hellip;) Ce qui se sait déjà =\u0026gt; le rapport pourra confirmer ou infirmer Des éléments sur ce que ne couvre pas vos données =\u0026gt; ouverture  La problématique # Remarques",content:"La note bibliographique # Remarques\n En rester à des publications statistiques, notemment des analyses sociologiques (un bon article de presse va s\u0026rsquo;appuyer sur une publication)  A quoi ça servira ?\n Il faut au maximum se baser sur des références bibliographiques (éviter le \u0026ldquo;on sait que\u0026hellip;\u0026rdquo;) Avoir des éléments \u0026ldquo;métier\u0026rdquo; sur le sujet (Introduction, cadrage, plan, \u0026hellip;) Ce qui se sait déjà =\u0026gt; le rapport pourra confirmer ou infirmer Des éléments sur ce que ne couvre pas vos données =\u0026gt; ouverture  La problématique # Remarques\n Définir une problématique, ce n\u0026rsquo;est pas \u0026ldquo;juste\u0026rdquo; trouver une jolie question C\u0026rsquo;est toute la démarche de réflexions autour essentiellement de la bibliographie pour affiner les pistes de recherche Taille adapté :  trop restreint, vous aurez vite fait le tour trop large, vous ne pourrez pas y répondre correctement dans les temps et nombre de pages impartis La problématique pourra être élargie si nécessaire au second semestre   Attention : vous ne pourrez pas détecter de causalité. C\u0026rsquo;est un projet de statistique descriptives, on peut \u0026ldquo;juste\u0026rdquo; trouver les variables qui fonctionnent ensemble =\u0026gt; reflexion et bibliographie  A quoi ça sert ?\n \u0026ldquo;Angle d\u0026rsquo;attaque\u0026rdquo; =\u0026gt; choix de variable, méthodes statistiques, plan, \u0026hellip;  Le choix de variables # Remarques\n Ne pas négliger le temps de construction de votre table de données Sélectionner dès maintenant toute variable pouvant avoir un rapport plus ou moins éloignée avec votre sujet Pour le premier semestre, réeffectuer une sélection plus fine ne conservant que des variables en lien direct : les méthodes uni/bivariées ne vous permettrons que de gérer un nombre limité de variables Au second semestre vous aurez vu des méthodes multivariées qui sont conçues pour gérer beaucoup de variables Il faudra parfois construire des variables à partir des variables \u0026ldquo;brutes\u0026rdquo; En cas de changement de logiciel, il est possible d\u0026rsquo;effectuer un export/import et pas forcément une recréation de zéro  A quoi ça sert/servira ?\n Une connaissance du stock de variables peut aider à orienter correctement votre problématique (éviter de se focaliser sur un élément dont on a aucune mesure) La définition de la problématique (et des \u0026ldquo;sous problématiques\u0026rdquo;) guide le choix final des variables La problématique pourra être élargie si nécessaire au second semestre  Le choix de la ou des population.s, du ou des millésime.s # Question systématiques avant chaque traitemement de variables :\n Quel est l\u0026rsquo;individu statistique ? Quelle est la population ?  Spoiler : la réponse ne sera jamais ici un ménage, les ménages de France, mais plutôt les communes de plus de 10000 habitants de France métropolitaine.\n En priorité lors de croisements essayer d\u0026rsquo;utiliser les mêmes tables (exemple : \u0026ldquo;Communes 2020\u0026rdquo;) Possibilité d\u0026rsquo;associer deux millésimes \u0026ldquo;proches\u0026rdquo; si on ne peut faire autrement En cas de tables différentes vérifier les jointures (par exemple pour les communes, chaque années il y a des petits changements) Penser à récupérer la source en même temps que la donnée : Institut, Administration, Entreprise dont est issu la donnée et nom de l\u0026rsquo;enquete, de la base, etc (Insee RP, \u0026hellip;)  A quoi ça sert/servira ?\n Ne pas interpréter à côté, avoir une problématique cohérente titre, champ, source  Le plan #  Garant de la cohérence de votre rapport Nous validerons ensemble un plan, pas des titres !!  L\u0026rsquo;analyse uni/bi variée #  Des statistiques univariées pour connaitre la composition de la population Sélectionner en fonction de votre bibliographie par exemple des croisements a priori pertinents pour l\u0026rsquo;analyse Rester concis sur les résultats  Ne pas oublier les indicateurs de base (moyenne, variance, médiane, mode, etc.) sur vos variables d\u0026rsquo;intêret Résultats \u0026ldquo;complexe\u0026rdquo; : Choix d\u0026rsquo;un tableau ou d\u0026rsquo;un graphique avec son titre, champ, source, note de lecture Préciser ce qui est à remarquer dans le résultats statistique en faisant attention à ne pas surinterpréter    On ne vous reprochera pas de ne pas avoir de réultats sensationnels s\u0026rsquo;il n\u0026rsquo;y en a pas à trouver, on vous reprochera des résultats issus de surinterprétation\nL\u0026rsquo;outil cartographique intégré au site #  Outils de visualisation des données sous forme de carte Possibilité d\u0026rsquo;importer des variables calculées par vos soins Pertinent pour un sujet sur les territoires  MAIS\n NE PAS se forcer à avoir une carte pour avoir une carte NE PAS surutiliser l\u0026rsquo;outil une carte doit être lisible et doit porter une information  Une carte sur une variable brute équivaut techniquement à imprimer un tableau de donnée de brute (donc pas un statistique à proprement parler), la plus value, c\u0026rsquo;est quand on veut s\u0026rsquo;en serivir pour repérer un zone géographique pas forcément évidente à identifier avec un variable (le nord, la diagonale du vide, les alentours de grandes villes, les frontières, \u0026hellip;)\n2 variables liées peuvent être détectées en observant que les cartes des deux variables \u0026ldquo;se ressemblent\u0026rdquo;, mais il utiliser des outils plus précis pour le montrer (coefficient de correlation, tableau de contingence, \u0026hellip;)\n"}).add({id:2,href:"/docs/ensai/projet-ensai/questions-frequentes/",title:"Questions fréquentes",description:"Les variables / le site # https://www.observatoire-des-territoires.gouv.fr/donnees_ouvertes\nAu delà des données en elles même\n Des descriptions sur chaque indicateur En particulier la source Vous avez la possbilité d\u0026rsquo;aller sur le site de la source pour avoir des informations complémentaires sur les variables  Je ne suis pas un expert de ces données, je n\u0026rsquo;aurai aucune plus-value par rapport à ces informations !\nLe public #   Le rapport s\u0026rsquo;adresse à un statisticien et non au grand public",content:"Les variables / le site # https://www.observatoire-des-territoires.gouv.fr/donnees_ouvertes\nAu delà des données en elles même\n Des descriptions sur chaque indicateur En particulier la source Vous avez la possbilité d\u0026rsquo;aller sur le site de la source pour avoir des informations complémentaires sur les variables  Je ne suis pas un expert de ces données, je n\u0026rsquo;aurai aucune plus-value par rapport à ces informations !\nLe public #   Le rapport s\u0026rsquo;adresse à un statisticien et non au grand public\n Ne pas hésiter à utiliser les méthodes vues en cours On peut réintroduire les méthodes pour justifier l\u0026rsquo;utilisation par exemple mais il ne faut pas refaire le cours dans le rapport Un bon tableau vaut mieux qu\u0026rsquo;un graphique illisible\u0026hellip;    Le rapport s\u0026rsquo;adresse à un statisticien qui NE connait PAS le domaine d\u0026rsquo;étude\n Présenter les données, les variables choisies avec un nom en clair (ne pas utiliser d\u0026rsquo;éventuels nommages) Il faut détailler un minimum le sens des variables quand ce n\u0026rsquo;est pas évident    Les variables créées #  Il sera parfois plus simple de travailler sur une variable recalculée, avec des regroupements de modalité, des transformations en classes, ou sur des variables agrégées, etc Il faut TOUJOURS préciser ce qui a été fait. Même si le code est fourni, la simple lecture du rapport DOIT suffire à comprendre tout ce qui a été fait depuis les données brutes jusqu\u0026rsquo;à votre analyse Attention à être cohérent dans le passage d\u0026rsquo;une variable quanti en classes Il faut TOUJOURS justifier le pourquoi de ce recalcul Souvent utiliser des effectifs n\u0026rsquo;est pas une bonne idée, il vaut mieux des fréquences : il faudra parfois calculer ces fréquences  exemple : nombre de gymnases VS nombre de gymnases pour 10000 habitant    La forme #   Eléments basique\n On vous donnera des consignes de rendu, le respect de ces consignes compte même de façon minime dans la notation, ne perdez pas de points la dessus\u0026hellip; En particulier pensez à mettre l\u0026rsquo;intitulé du sujet, le numéro de groupe et vos noms sur tous les livrables La rédaction n\u0026rsquo;est pas le premier critère de notation mais un minimum est attendu (orthographe, titre explicite de préférence informatif par exemple) Relisez vous    Le code / les sorties brutes / les annexes\n annexe = le rapport doit être lisible sans ses annexes annexe = ce qui ne figurerait pas forcément dans le rapport s\u0026rsquo;il était vraiment publié Il vous est demandé de fournir le code SAS ou R utilisé pour obtenir vos résultats (plutôt dans un fichier à part) Il faut mettre en annexe certaines sorties brute des logiciels qui vous ont servi mais ne peuvent figurer telles quelles dans le rapport (et uniquement ce qui a servi !)  Pour le premier semestre, ce ne sera pas nécessaire normalement car ce sont quasiment les sorties brutes qui seront utilisées (NE PAS mettre le tableau correspondant aux graphiques par exemple) Pour le second semestre, ce sera nécessaire (sorties d\u0026rsquo;analyse factorielles)      Le tableaux :\n Eviter de faire des impressions d\u0026rsquo;écran des tableaux issus des logiciels Ne pas s\u0026rsquo;embéter à faire une PROC TABULATE utra complexe si c\u0026rsquo;est juste du formattage !! Refaire le tableau au propre dans l\u0026rsquo;outil d\u0026rsquo;édition utilisé (Word, latex,\u0026hellip;)    Un élément non lisible est inutile (cette remarque est valable pour les annexes !)\n  Lorsque des interprétation font appels à des choix arbitraire (choix de seuil, \u0026hellip;) précisez les explicitement ou restez en à des comparaisons\n  "}).add({id:3,href:"/docs/",title:"Docs",description:"",content:""}).add({id:4,href:"/docs/dev/",title:"Développement",description:"",content:""}).add({id:5,href:"/docs/ensai/",title:"Ensai",description:"TDs et TPs",content:""}).add({id:6,href:"/docs/ensai/projet-ensai/",title:"Projet statistique",description:"",content:""}),search.addEventListener("input",t,!0);function t(){const s=5;var n=this.value,o=e.search(n,{limit:s,enrich:!0});const t=new Map;for(const e of o.flatMap(e=>e.result)){if(t.has(e.doc.href))continue;t.set(e.doc.href,e.doc)}if(suggestions.innerHTML="",suggestions.classList.remove("d-none"),t.size===0&&n){const e=document.createElement("div");e.innerHTML=`No results for "<strong>${n}</strong>"`,e.classList.add("suggestion__no-results"),suggestions.appendChild(e);return}for(const[r,a]of t){const n=document.createElement("div");suggestions.appendChild(n);const e=document.createElement("a");e.href=r,n.appendChild(e);const o=document.createElement("span");o.textContent=a.title,o.classList.add("suggestion__title"),e.appendChild(o);const i=document.createElement("span");if(i.textContent=a.description,i.classList.add("suggestion__description"),e.appendChild(i),suggestions.appendChild(n),suggestions.childElementCount==s)break}}})()